ORE_RELICS_TIMER:_=>{const{normalize:n}=_;return n(["次のレリックまで："])},TID_PLANET_DESCR_GENERATING_RELIC:_=>{const{normalize:n}=_;return n(["水素の補給を待機中です。"])},TID_STATUS_LOADING_RELIC:_=>{const{normalize:n}=_;return n(["レリックを積み込み中"])},TID_NEW_RELIC_CREATED:_=>{const{normalize:n}=_;return n(["新たなレリックが1個生成されました"])},TID_NEW_RELICS_CREATED:_=>{const{normalize:n,interpolate:r,list:T}=_;return n(["新たなレリックが",r(T(0)),"個生成されました"])},TID_STAR_GOALS_DESCR_WHITESTAR:_=>{const{normalize:n}=_;return n(["コーポレーションのメンバーと協力して、消滅間近のホワイトスターへ行きレリックを回収してください。\n全ての惑星が少しずつレリックを生成します。レリックは、レリックを輸送する輸送船が恒星系の外にジャンプすることで獲得できます。\nレリックの生成は、採掘船を使って惑星に水素を供給することでスピードアップさせられます。\n別のコーポレーションがこのエリアで活動している可能性があります。戦艦は別のコーポレーションの艦船に対して攻撃を行います。"])},TID_WHITE_STAR_FOUND_HINT:_=>{const{normalize:n}=_;return n(["コーポレーションのメンバーと相談して、レリック回収を実施するためにホワイトスターへ送る艦船を決定してください。\nホワイトスター周辺では、艦船の移動が非常に遅くなります。送り出した艦船を帰還させるまでに数日間かかる場合があります。"])},TID_WHITE_STAR_SPECTATOR_INFO:_=>{const{normalize:n}=_;return n(["スペクテイター状態のため、このホワイトスターに船を送ることはできません。\nホワイトスターに積極的に参加するには、探査時に参加者リストに含まれている必要があります。"])},TID_WHITE_STAR_LBL_PARTICIPANTS:_=>{const{normalize:n}=_;return n(["参加条件を満たすメンバー"])},TID_WHITE_STAR_LBL_ACTIVE_PARTICIPANTS:_=>{const{normalize:n}=_;return n(["参加者"])},TID_WS_PARTICIPANTS_HINT:_=>{const{normalize:n}=_;return n(["発見した恒星の規模によっては、リストの下部にいるメンバーは参加できない可能性があります。"])},TID_SCANNING_WS:_=>{const{normalize:n}=_;return n(["ホワイトスターをスキャン中"])},TID_WS_SCAN_TIME_HINT:_=>{const{normalize:n,interpolate:r,list:T}=_;return n(["探査には数時間かかる場合があります。ミッションは恒星を発見してから",r(T(0)),"時間後に始まります。"])},TID_UNABLE_TO_USE_WS_SCANNER:_=>{const{normalize:n}=_;return n(["スキャン不可"])},TID_WS_NO_CORP:_=>{const{normalize:n}=_;return n(["ホワイトスター・スキャナーを使用するには、コーポレーションに参加していなければなりません。"])},TID_WS_DIALOG_FIND_CORP:_=>{const{normalize:n}=_;return n(["コーポレーションを探す"])},TID_WS_CANCEL_SEARCH:_=>{const{normalize:n}=_;return n(["探査をキャンセル"])},TID_WS_CANCEL_SEARCH_CONFIRM:_=>{const{normalize:n}=_;return n(["本当にホワイトスターの探査をキャンセルしますか？"])},TID_WS_CANTSCAN_REASON_MEMBERS:_=>{const{normalize:n,interpolate:r,list:T}=_;return n(["ホワイトスター・ミッションを開始するには、参加条件を満たすメンバーが最低",r(T(0)),"人必要です。"])},TID_WS_CANTSCAN_REASON_NOT_OFFICER:_=>{const{normalize:n}=_;return n(["準備が整ったら、コーポレーションのオフィサーにホワイトスターのスキャンを開始するよう依頼してください。"])},TID_JUMP_CONFIRM_WS_CARGO_LOST:_=>{const{normalize:n}=_;return n(["ホワイトスターにジャンプした輸送船と採掘船は、全ての積荷を失います。続けますか？"])},TID_JUMP_CONFIRM_MINER:_=>{const{normalize:n}=_;return n(["ジャンプした後、採掘船は回収した水素を全て失います。続けますか？"])},TID_PLANET_INFO_HYDRO_PER_RELIC:_=>{const{normalize:n,interpolate:r,list:T}=_;return n(["レリック1個に必要な水素量（最初の",r(T(0)),"レリック）"])},TID_PLANET_INFO_HYDRO_PER_RELIC_2:_=>{const{normalize:n,interpolate:r,list:T}=_;return n(["レリック1個に必要な水素量（次は",r(T(0)),"レリック）"])},TID_PLANET_INFO_HYDRO_PER_RELIC_3:_=>{const{normalize:n}=_;return n(["レリック1個に必要な水素量（追加レリック）"])},TID_PLANET_INFO_NUM_RELICS_GENERATED:_=>{const{normalize:n}=_;return n(["生成されたレリックの合計"])},TID_PLANET_INFO_HYDRO_PER_RELIC_DESCR:_=>{const{normalize:n}=_;return n(["新たなレリックを1個生成するためにこの惑星が必要とする水素量預ける量が少ない場合でも、次のレリック生成に役立ちます。"])},TID_WHITE_STAR_PLANET_DESCR:_=>{const{normalize:n}=_;return n(["ホワイトスターの惑星は、採掘船がレリックを生成できるようにします。ホワイトスターの惑星に預けられたどんな量の水素も、次のレリックの生成に貢献します。大量の水素を預けて一度に複数のレリックを生成してください。\n一度生成されたレリックは、輸送船によってピックアップされるまで惑星に保管されます。システムから安全に輸送されるレリックは、この試合のコーポレーションのスコアに寄与します。超新星で回収されるレリックの量が多いコーポレーションがゲームに勝利します。\nレリックの生成効率は、より多くのレリックが生成されるにつれて低下します。可能な限り多くのホワイトスターの惑星を制御して、最大限のレリックを回収することを目指してください。"])},TID_JUMP_CMD_ERROR_TRANSPORT_TOO_SMALL_FOR_WS:_=>{const{normalize:n,interpolate:r,list:T}=_;return n(["輸送船がホワイトスターへジャンプするには、貨物キャパシティが最低",r(T(0)),"必要です"])},TID_WHITE_STAR_SEARCH_HINT_1:_=>{const{normalize:n}=_;return n(["ホワイトスターでは、時間が非常に遅く進みます。これによって生まれる余裕時間を利用して、コーポレーションのメンバー間で戦略を立ててください。"])},TID_WHITE_STAR_SEARCH_HINT_2:_=>{const{normalize:n}=_;return n(["採掘船を使ってホワイトスター周辺の惑星に水素を供給することで、レリックの生成を早めることができます。採掘船の作業中は、船を敵艦の攻撃から守るようにしてください。"])},TID_WHITE_STAR_SEARCH_HINT_3:_=>{const{normalize:n}=_;return n(["ホワイトスターには限られた数の艦船のみを送ることができます。コーポレーション内で、どの船を、いつ送るか前もって検討すると良いでしょう。"])},TID_WHITE_STAR_SEARCH_HINT